      // create authorization header with jwt token\r\n        let currentUser = JSON.parse(localStorage.getItem('currentUser'));\r\n        if (currentUser && currentUser.access_token) {\r\n            let headers = new Headers({ 'Authorization': 'Bearer ' + currentUser.access_token });\r\n            return new RequestOptions({ headers: headers });\r\n        }\r\n    }\r\n}\n    \n\n\n\n\n\n\n\n\n                   \n    \n         results matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"},"classes/Article.html":{"url":"classes/Article.html","title":"class - Article","body":"\n                   \n\n\n\n\n\n\n\n  Classes\n  Article\n\n\n\n    \n        Infos\n    \n    \n        Source\n    \n\n\n\n    \n        \n            File\n        \n        \n            src/app/core/article/article.model.ts\n        \n\n\n\n\n\n\n\n            \n                \n                    \n                        Properties\n                    \n                    \n                        \n                            \n                                \n                                     author\n                                \n                            \n                            \n                                \n                                    author:     string\n            \n                                \n                            \n                                \n                                    \n                                        Defined in src/app/core/article/article.model.ts:6\n                                    \n                                \n                        \n                    \n                    \n                        \n                            \n                                \n                                     content\n                                \n                            \n                            \n                                \n                            